    // at least need error.message from spawn errors
    if ("message" in result && result.message) {
        messages.push({
            name: "MESSAGE",
            type: "text",
            text: result.message,
        });
    }

    if (result.signal) {
        messages.push({
            name: "SIGNAL",
            type: "text",
            text: result.signal,
        });
    }

    // // when is this set? what conditions? I tried `kill -9` and didn't trigger "error" event
    // if ("killed" in result && result.killed) {
    //     // killed == true is the only time to include this
    //     messages.push({
    //         name: "KILLED",
    //         type: "text",
    //         text: "Process was killed",
    //     });
    // }

    if (result.stdout) {
        messages.push({
            name: "STDOUT",
            type: "text",
            text: result.stdout,
        });
    }
    if (result.stderr) {
        messages.push({
            name: "STDERR",
            type: "text",
            text: result.stderr,
        });
    }
    return messages;
}

